typedef struct fileops_t_ {
void (*fops_open)(struct fileops_t_ *self, const char *file);
void (*fops_close)(struct fileops_t_ *self);
int (*fops_write_page)(struct fileops_t_ *self, void *buf, int oft);
int (*fops_memcpy)(struct fileops_t_ *self, void *dst, void *src, int count);
int (*fops_erase_page)(struct fileops_t_ *self, int page_number);
int (*fops_flash_lock)(struct fileops_t_ *self, int lock);
int (*fops_flash_page_locker)(struct fileops_t_ *self, int page_number, int lock);
void (*fops_flash_write_protect)(struct fileops_t_ *self, int enable);
const uint32_t flash_addr;
const uint32_t page_size;
const uint32_t num_regions;
const uint32_t erase_page_min;
const uint32_t erase_buffer_size;
uint8_t *erase_buffer;
write_buffers_t write_buffers[NUM_WRITERS];
#ifdef __x86_64__
uint8_t *memmap;
#endif
} fileops_t;
